'''
Get Weibo emotions from API
'''
def retrieve_weibo_json(access_token):
    api_url = "https://api.weibo.com/2/emotions.json?access_token=%s" % access_token
    try:
        json_url = urllib.request.urlopen(api_url)
        data = json.loads(json_url.read())
        return data
    except Exception as e:
        print(e)

'''
Read the JSON file and put only the name and image URL of the emoji into a list of dictionaries
'''
def get_weibo_emojis(access_token):
    WEIBO_EMOJI = [] # Reset the list of dictionaries
    json_file = retrieve_weibo_json(access_token)
    for weibo_emoji in json_file:
        emoji = {}
        name = weibo_emoji["phrase"]
        src = weibo_emoji["url"]
        emoji["name"] = name
        emoji["src"] = src
        WEIBO_EMOJI.append(emoji)


'''
Parse the table from the 2 target links and get the list of emojis and its corresponding unicodes
'''
def get_unicode_emojis():
    GLOBAL_EMOJI = [] # Reset the list of dictionaries
    target_url1 = "https://unicode.org/emoji/charts/full-emoji-list.html"
    target_url2 = "https://unicode.org/emoji/charts/full-emoji-modifiers.html"
    req1 = requests.get(target_url1)
    soup1 = BeautifulSoup(req1.text, 'html.parser')
    table1 = soup1.find("table")
    req2 = requests.get(target_url2)
    soup2 = BeautifulSoup(req2.text, 'html.parser')
    table2 = soup2.find("table")
    for table_row in table1.findAll("tr")[3:]:
        emoji = {}
        try:
            unicode = table_row.find("td", attrs={"class": "code"}).string
            name = table_row.find("td", attrs={"class": "name"}).string
            # Put the name of emoji and its unicode into dictionary
            emoji["unicode"] = unicode
            emoji["name"] = name
        except Exception as e:
            pass
        GLOBAL_EMOJI.append(emoji)
    for table_row in table2.findAll("tr")[3:]:
        emoji = {}
        try:
            unicode = table_row.find("td", attrs={"class": "code"}).string
            name = table_row.find("td", attrs={"class": "name"}).string
            # Put the name of emoji and its unicode into dictionary
            emoji["unicode"] = unicode
            emoji["name"] = name
        except Exception as e:
            pass
        GLOBAL_EMOJI.append(emoji)


'''
Convert the unicode format to HTML format
'''
def convert_unicode(unicode):
    html_code = "&#x"
    html_code += unicode[2:]
    html_code += ";"
    return html_code


'''
Replace the weibo emoji name with an equivalent global emoji
'''
def find_replacement(weibo_emoji):
    equiv_name = EMOJI_EQUIV[weibo_emoji]
    # look for equivalent unicode
    for emoji_dict in GLOBAL_EMOJI:
        global_unicode = emoji_dict.get("unicode")
        global_name = emoji_dict.get("name")
        if global_name == equiv_name:
            html_unicode = convert_unicode(global_unicode)
    return html_unicode

'''
Replaces the weibo emoji in the input text to an equivalent global emoji
'''
def convert_text(emoji_text):
    for weibo_emoji in WEIBO_EMOJI:
        emoji_name = weibo_emoji["name"]
        if emoji_name in emoji_text:
            replacement = find_replacement(emoji_name)
            emoji_text = emoji_text.replace(emoji_name, replacement)
    return emoji_text


